package com.class09;

public class Oto {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		for(int i=0; i<10; i++ ) {
			
			for(int j=0; j<10; j++) {
		
				for( int a=0; a<10; a++) {
					
					for( int c=0; c<10; c++) {
				
						System.out.println(i+""+j+""+a+""+c);
					
					}
				
				}
			}
		}
	}
}
	